  input: TEXT,F3A,,"Some fields are blocked and not allowing me to mark them  or write
    in them. For instance, 'in-kind' is blocked for me to mark for individual contributions.
    Therefore, I described the contribution as a contribution of 'services' such as
    'consulting' and 'marketing,' etc. I spoke with Kelly Scindian, at the FEC, about
    this. She suggested deleting and re-entering the individual, however, a message
    pops up when I try to delete an item. The message says that the field is required
    by the FEC and may not be deleted.04/15/2002.Amendment on 07/11/2002. While talking
    to FEC report analysis department, I was informed on how to properly show the
    in-kind contributions. They advised me to delete the in-kind contributions that
    were not showing as in-kind, and then to re-enter each contribution as a new contribution
    with the same information. They said that the  'in-kind' box would finally work
    if I did it like this, and that is what I did, following FEC advice. Karen Balderama
    at FEC advised me."
